import{_ as t,c as e,o as s,a4 as n}from"./chunks/framework.uQk9_EO2.js";const a="/docs/cocos/assets/prefab-asset.Djfn25Oh.png",o="/docs/cocos/assets/prefab-instance.Ds4SureC.png",r="/docs/cocos/assets/prefab-edit-mode.C5eSbXw2.png",i="/docs/cocos/assets/nested-prefab.D5R1WJR7.png",d="/docs/cocos/assets/create.Djpz1his.png",l="/docs/cocos/assets/create-prefab.ByELIX3k.gif",g="/docs/cocos/assets/use-prefab.DmYTAJsr.gif",c="/docs/cocos/assets/prefab-edit-mode.B75Cm3pd.gif",h="/docs/cocos/assets/edit-prefab.D1jC9LA7.png",f="data:image/png;base64,",p="data:image/png;base64,",b="data:image/png;base64,",A="data:image/png;base64,",m="/docs/cocos/assets/prefab-mounted-children.Dd7gJjUj.png",P="/docs/cocos/assets/instance-add-component.BGzuLQ_f.png",u="/docs/cocos/assets/instance-remove-component.DK3g7UJx.png",y="data:image/png;base64,",w="data:image/png;base64,",G=JSON.parse('{"title":"Prefab","description":"","frontmatter":{},"headers":[],"relativePath":"en/asset/prefab.md","filePath":"en/asset/prefab.md","lastUpdated":1712305443000}'),x={name:"en/asset/prefab.md"},k=n('<h1 id="prefab" tabindex="-1">Prefab <a class="header-anchor" href="#prefab" aria-label="Permalink to &quot;Prefab&quot;">​</a></h1><p>Prefab is used to store some scene objects that can be reused, it can contain nodes, components, and data in components. The instances generated by the prefab asset can not only inherit the data of the template, but also have it&#39;s own customized data modification.</p><h2 id="basic-concepts" tabindex="-1">Basic Concepts <a class="header-anchor" href="#basic-concepts" aria-label="Permalink to &quot;Basic Concepts&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Name</th><th style="text-align:left;">Description</th><th style="text-align:left;">Example</th></tr></thead><tbody><tr><td style="text-align:left;">Prefab Asset</td><td style="text-align:left;">The asset of prefab in <strong>Assets</strong> panel, which is the serialize file of Prefab.</td><td style="text-align:left;"><img src="'+a+'" alt="prefab asset"></td></tr><tr><td style="text-align:left;">Prefab Instance</td><td style="text-align:left;">When the <strong>Prefab Asset</strong> is drag to the <strong>Hierarchy</strong> panel, it will generate a <strong>Prefab Instance</strong>. Its root node is currently marked in dark green, and its child nodes are bright green</td><td style="text-align:left;"><img src="'+o+'" alt="prefab instance"></td></tr><tr><td style="text-align:left;">Prefab Editing Mode</td><td style="text-align:left;">Double-click the <strong>Prefab Asset</strong> to enter the prefab editing mode. At this time, all non-nested prefab nodes are displayed in bright green</td><td style="text-align:left;"><img src="'+r+'" alt="prefab edit mode"></td></tr><tr><td style="text-align:left;">Nested Prefab Instance</td><td style="text-align:left;">When a child node in a <strong>Prefab Asset</strong> is an instance of another <strong>Prefab Asset</strong>, we call this child prefab a nested prefab instance</td><td style="text-align:left;"><img src="'+i+'" alt="nested-prefab"></td></tr></tbody></table><h2 id="creating-a-prefab" tabindex="-1">Creating a Prefab <a class="header-anchor" href="#creating-a-prefab" aria-label="Permalink to &quot;Creating a Prefab&quot;">​</a></h2><p>There are two ways to create a prefab:</p><ol><li><p>After editing the <strong>Node</strong> in the <strong>Scene</strong>, drag the <strong>Nodes</strong> directly from the <strong>Hierarchy</strong> panel to the <strong>Assets</strong> panel to complete the creation of the <strong>Prefab</strong>.</p></li><li><p>Click the <strong>+</strong> button at the top left of <strong>Assets</strong>, or click the blank space of the panel, and then select <strong>Node Prefab</strong>. (New in v3.1.1)</p><p><img src="'+d+'" alt="create"></p></li></ol><p>After the creation is complete, the original <strong>Node</strong> will automatically become a <strong>Prefab Instance</strong>, its root node is currently marked in bright green, and its child nodes are dark green.</p><p><img src="'+l+'" alt="create-prefab"></p><h2 id="using-prefabs" tabindex="-1">Using Prefabs <a class="header-anchor" href="#using-prefabs" aria-label="Permalink to &quot;Using Prefabs&quot;">​</a></h2><p>Drag a <strong>Prefab Asset</strong> from the <strong>Assets</strong> panel to the <strong>Hierarchy</strong> panel or <strong>Scene</strong> panel to create a <strong>Prefab Node</strong> in the <strong>Scene</strong>.</p><p>In the <strong>Scene</strong>, the <strong>Prefab Instance</strong> objects data source comes from the deserialization of the <strong>Prefab Asset</strong> , so its data is synchronized with the <strong>Prefab Asset</strong> by default. If the attributes in the prefab instance are modified, the modified data will be stored In the <strong>Prefab Instance</strong>, it will not affect the <strong>Prefab Asset</strong> and the data of other <strong>Prefab Instance</strong> generated by it.</p><p><img src="'+g+'" alt="use-prefab"></p><h2 id="entering-prefab-editing-mode" tabindex="-1">Entering prefab editing mode <a class="header-anchor" href="#entering-prefab-editing-mode" aria-label="Permalink to &quot;Entering prefab editing mode&quot;">​</a></h2><p><strong>Double-click</strong> the <strong>Prefab Asset</strong> in the <strong>Assets</strong> panel to switch from <strong>Scene</strong> editing mode to <strong>Prefab editing</strong> mode. It is possible to edit the <strong>Prefab Assets</strong> in the <strong>Editor</strong>. After editing, click <strong>Save</strong> button in the <strong>Scene</strong> panel to save the edited <strong>Prefab Assets</strong>. Next, click the <strong>Close</strong> button to return to the Scene editing mode.</p><blockquote><p><strong>Note</strong>: please avoid multiple people modifying the same prefab asset at the same time, as this may lead to conflicts that cannot be resolved by <code>git</code> merging.</p></blockquote><p><img src="'+c+'" alt="edit mode"></p><h2 id="status-of-prefab-nodes" tabindex="-1">Status of prefab nodes <a class="header-anchor" href="#status-of-prefab-nodes" aria-label="Permalink to &quot;Status of prefab nodes&quot;">​</a></h2><p><strong>Prefab Nodes</strong> in the <strong>Inspector</strong> panel render <strong>green</strong> to indicate normal association with assets and render <strong>red</strong> to indicate that the associated assets no longer exist.</p><h2 id="editing-prefab-nodes-in-a-scene" tabindex="-1">Editing Prefab Nodes in a Scene <a class="header-anchor" href="#editing-prefab-nodes-in-a-scene" aria-label="Permalink to &quot;Editing Prefab Nodes in a Scene&quot;">​</a></h2><h3 id="general-operations" tabindex="-1">General Operations <a class="header-anchor" href="#general-operations" aria-label="Permalink to &quot;General Operations&quot;">​</a></h3><p>In the <strong>Hierarchy</strong> panel, select the <strong>Prefab Node</strong>, and notice there are several buttons that can be clicked at the top of the <strong>Inspector</strong> panel:</p><p><img src="'+h+'" alt="edit prefab"></p><table><thead><tr><th style="text-align:left;">Button Icon</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><img src="'+f+'" alt="unlink prefab"></td><td style="text-align:left;">Revert to <strong>normal node</strong>. <strong>Prefab Instance</strong> can become ordinary <strong>Nodes</strong>, that is, completely separated from the relationship between assets. This function is also available in the top-level menu <code>Node</code>. Support batch disassociation in v3.4.</td></tr><tr><td style="text-align:left;"><img src="'+p+'" alt="locate prefab"></td><td style="text-align:left;">Locating assets. It is convenient to quickly locate <strong>Prefab Asset</strong> in the <strong>Assets</strong> panel.</td></tr><tr><td style="text-align:left;"><img src="'+b+'" alt="revert prefab"></td><td style="text-align:left;">Restore from asset. Restore the data of the current <strong>Prefab Instance</strong> to the data in the <strong>Prefab Asset</strong>, but the name, location, and rotation will not be restored.</td></tr><tr><td style="text-align:left;"><img src="'+A+'" alt="apply prefab"></td><td style="text-align:left;">Update to asset. Update all data of the current <strong>Prefab Instance</strong> to the associated <strong>Prefab Asset</strong>.</td></tr></tbody></table><h3 id="add-new-node" tabindex="-1">Add New Node <a class="header-anchor" href="#add-new-node" aria-label="Permalink to &quot;Add New Node&quot;">​</a></h3><p>A new node added under the <strong>Prefab Instance</strong> will have a <strong>+</strong> sign in the lower right corner of the node name, and its data is stored under the <strong>Prefab Instance</strong>, so it will not affect the data of the associated <strong>Prefab Asset</strong>.</p><p><img src="'+m+'" alt="prefab mounted"></p><h3 id="add-new-component" tabindex="-1">Add New Component <a class="header-anchor" href="#add-new-component" aria-label="Permalink to &quot;Add New Component&quot;">​</a></h3><p>A new component added under the <strong>Prefab Instance</strong> will have a <strong>+</strong> sign at the end of the node name, and its data is stored under the <strong>Prefab Instance</strong>, it will not affect the data of the associated <strong>Prefab Asset</strong>.</p><p><img src="'+P+'" alt="instance-add-component"></p><h3 id="remove-component" tabindex="-1">Remove Component <a class="header-anchor" href="#remove-component" aria-label="Permalink to &quot;Remove Component&quot;">​</a></h3><p>A new component added under the <strong>Prefab Instance</strong> will have a deleted data item show in the <strong>Inspector</strong>, its data is stored under the <strong>Prefab Instance</strong>, it will not affect the data of the associated <strong>Prefab Asset</strong>.</p><p><img src="'+u+'" alt="instance-remove-component"></p><p>It will show two buttons in the end of deleted data item:</p><table><thead><tr><th style="text-align:left;">Button Icon</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><img src="'+y+'" alt="revert-remove-component"></td><td style="text-align:left;">Revert the removed component.</td></tr><tr><td style="text-align:left;"><img src="'+w+'" alt="apply-remove-component"></td><td style="text-align:left;">Apply the operation of removing the component to the associated <strong>Prefab Asset</strong>.</td></tr></tbody></table><h2 id="some-current-restrictions" tabindex="-1">Some Current Restrictions <a class="header-anchor" href="#some-current-restrictions" aria-label="Permalink to &quot;Some Current Restrictions&quot;">​</a></h2><ul><li>It is not allowed to delete the node created from the <strong>Prefab Asset</strong> in the <strong>Prefab Instance</strong>.</li><li>It is not allowed to change the hierarchical relationship of nodes created from the <strong>Prefab Asset</strong> in the <strong>Prefab Instance</strong>.</li><li>Do not allow prefabs to nest themselves.</li></ul>',37),B=[k];function R(D,Y,I,E,N,U){return s(),e("div",null,B)}const H=t(x,[["render",R]]);export{G as __pageData,H as default};
